// Importamos las clases asociadas
const Cliente = require('./Cliente');
const Contacto = require('./Contacto');
const Usuario = require('./Usuario');
const OrdenDetalle = require('./OrdenDetalle');

function Orden({
    idOrden = null,
    cliente = new Cliente(),
    contacto = new Contacto(),
    domicilio = { idDomicilio: null, direccion: "", provincia: "" },
    usuario = new Usuario(),
    detalle = [],
    fecha_carga = new Date().getDate(),
    fecha_entrega = null,
    subTotal = 0.0,
    total = 0.0,
    estado = "parcial_pendiente",
    pagado = 0.0,
}) {
    this.idOrden = idOrden;
    this.cliente = cliente;
    this.contacto = contacto;
    this.domicilio = domicilio;
    this.usuario = usuario;
    this.detalle = detalle; // Se espera un array de instancias de OrdenDetalle
    this.fecha_carga = fecha_carga;
    this.fecha_entrega = fecha_entrega;
    this.subTotal = subTotal;
    this.total = total;
    this.estado = estado;
    this.pagado = pagado;
}

module.exports = Orden;
